import React from 'react';

const VideoPlayer= props =>{

  console.log(props);
  const {videoId} = props;
  if(!videoId)return null;
  const url=`https://youtube.com/embed${props.videoId}`
  return (
    <div>
      <iframe src={url} />
    </div>
  )


}
export default VideoPlayer;
